member.remarks:
This should be called in a using statement in order to dispose of the connection when completed.

        using (var service = new CountyService(loader))
        {
            return await service.CallCheckCredentialsAsync(user, password);
        }

This should be called in a using statement in order to dispose of the connection when completed.

        using (var service = new FilerService(loader))
        {
            return await service.CallCheckCredentialsAsync(user, password);
        }

member.example:
This is the implmentation for the ConfigFileEndpointLoader which is included with this library. If you wish to create your own custom loader, you can 
use this as an example in order to do so.

    public class ConfigFileEndpointLoader : IEndpointLoader
    {
       public string LoadEndpointBase()
       {
           return ConfigurationManager.AppSettings["ENDPOINT"];
       }

       public string LoadAccountEndpoint()
       {
           return ConfigurationManager.AppSettings["ACT_ENDPOINT_ASMX"];
       }

       public string LoadUCCEndpoint()
       {
           return ConfigurationManager.AppSettings["UCC_ENDPOINT_ASMX"];
       }

       public BasicHttpBinding LoadBinding()
       {
           return new BasicHttpBinding
                  {
                    Name = "org.gsccca.ucc",
                    MaxReceivedMessageSize = int.MaxValue,
                    MaxBufferSize = int.MaxValue,
                    CloseTimeout = new TimeSpan(0, 5, 0),
                    OpenTimeout = new TimeSpan(0, 5, 0),
                    ReceiveTimeout = new TimeSpan(0, 5, 0),
                    SendTimeout = new TimeSpan(0, 5, 0)
                   };
        }
    }

remarks.example:
In order to deserialize perform the following call.

var FilingData = XmlFormatter{GSCCCA.eFile.Integration.IacaFile.Document}.Deserialize(xml);

In order to serialize perform the followign call.

var xml = XmlFormatter{GSCCCA.eFile.Integration.IacaFile.Document}.Serialize(FilingData);
